import React from 'react'
import { FaMapMarkerAlt } from 'react-icons/fa'

import { DropdownComponent } from '../dropdown'
import { FormInput, FormInputContainer, FormInputLabel } from './styles'

export const InputFrom: React.FC = () => {
  return (
    <FormInputContainer>
      <FormInput type='text' name='origin' id='origin' />
      <FormInputLabel>City of origin</FormInputLabel>
      <FaMapMarkerAlt size={24} />

      <DropdownComponent
        cities={[
          ['test 1', 0, 1],
          ['test 2', 0, 1],
        ]}
      />
    </FormInputContainer>
  )
}
